import React from 'react'

const Grid = () => {
  
  return (
    <table>
      <thead class="thead-dark">
        <tr>
          <th scope="col">Month</th>
          <th scope="col">Time In</th>
          <th scope="col">Time Out</th>
          <th scope="col">Hours</th>
          <th scope="col">Notes</th>
        </tr>
        <tbody>
         {[1,2,4].map(item=>{
          return (
            <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          )
         })}

        </tbody>

      </thead>

    </table>

  )
}

export default Grid
